mapper.select:
select 

from tbsellcheck
where fsCheckBillNo = #{fscheckbillno,jdbcType=VARCHAR}
  and fsSellNo = #{fssellno,jdbcType=VARCHAR}
  and fsShopGUID = #{fsshopguid,jdbcType=VARCHAR}

mapper.delete:
delete from tbsellcheck
where fsCheckBillNo = #{fscheckbillno,jdbcType=VARCHAR}
  and fsSellNo = #{fssellno,jdbcType=VARCHAR}
  and fsShopGUID = #{fsshopguid,jdbcType=VARCHAR}
